        FORTNITE_GIFT_INVENTORY_INFO:
          "\xa1Obt\xe9n equipamiento a juego con tu {guardOutfitName}!\n\nA partir del 4 de mayo, desbloquea el Drop de Discord de {rewardName} de una de estas maneras:\n\nTransmite en directo y comparte tu pantalla de Fortnite en Discord durante 15 minutos o m\xe1s para al menos un amigo de Discord.\n\nTras 15 minutos compartiendo la pantalla con un amigo, recibir\xe1s un enlace como regalo en Ajustes > Inventario de regalos.\n\n\xa1Haz clic en el enlace para iniciar sesi\xf3n en tu cuenta de Epic Games y el envoltorio se a\xf1adir\xe1 a tu taquilla de Fortnite!\n\n\xbfNo puedes transmitir? \xa1Tambi\xe9n puedes aceptar la misi\xf3n del bot de Discord! Primero, \xfanete al [servidor de Discord oficial de Fortnite](http://discord.gg/fortnite).\n\nEn este servidor, ver\xe1s un bot con el que podr\xe1s interactuar para unirte a la misi\xf3n de Discord.\n\nDespu\xe9s de interactuar con \xe9l, acceder\xe1s a una p\xe1gina en la que podr\xe1s vincular tus cuentas de Epic y Discord.\n\nUna vez vinculadas, participa en la misi\xf3n y completa una tarea en Discord y otra en Fortnite.\n\nCuando completes ambas tareas, \xa1el envoltorio se a\xf1adir\xe1 a tu taquilla de Fortnite!\n\n\xa1Tienes m\xe1s informaci\xf3n en nuestra publicaci\xf3n del blog!\n",
